import React, { useState, useEffect } from "react";
import { makeStyles, withStyles } from "@material-ui/styles";
import { func } from "prop-types";
import {
  Typography,
  Grid,
  Card,
  CardContent,
  CardActions,
  Button,
  IconButton,
  CardHeader,
  TextField,
  Radio,
  RadioGroup,
  FormControlLabel,
  Paper,
} from "@material-ui/core";
import { colors } from "@material-ui/core";
import IndexInsee from "./Components/IndexInsee";

const useStyles = makeStyles((theme) => ({
  root: {
    padding: theme.spacing(6),
  },
  paper: {
    padding: 10,
  },
  titleBar: {
    backgroundColor: theme.palette.primary.main,
    color: colors.grey[50],
    marginBottom: 10,
    textAlign: "center",
    padding: 10,
  },
  right: {
    paddingTop: 10,
    textAlign: "right",
  },
  gridCell: {
    justifyContent: "center",
  },
  cellRight: {
      display: "flex",
    textAlign: "right",
    paddingRight: 25,
  },
  titleSection: {
    marginBottom: 2,
    marginLeft: 10,
  },
  textWhite: {
    color: colors.grey[50],
  },
  center: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
  },
  container: {
    padding: 15,
  },
  button: {
    marginRight: 20,
    marginLeft: 20,
  },
  btnAction: {
    backgroundColor: theme.palette.action.main,
    color: theme.palette.white,
  },
  title: {
    paddingTop: 30,
  },
}));

const Settings = () => {
  const classes = useStyles();
  const [showAddEstateModal, setShowAddEstateModal] = useState(false);
  const [component, setComponent] = useState("");
  const [accommodations, setData] = useState(null);
  const [listFiltre, setFiltres] = useState([]);

  return (
    <div className={classes.root}>
      <Grid container>
        <Grid item lg={12} md={12} xs={12}>
          <IndexInsee />
        </Grid>
        <Grid item lg={6} md={6} xs={6} className={classes.title}>
          <Typography variant="h1">Les templates</Typography>
          <Typography variant="body1">
            Ici tu peux modifier les locataires des logements ainsi qu'ajouter
            un logement via le button ajouter.
          </Typography>
        </Grid>
        <Grid item lg={6} md={6} xs={6} className={classes.cellRight}>
          <Button variant="contained">Ajouter un template</Button>
        </Grid>
        <Grid item lg={12} md={12} xs={12}>
          <Button variant="contained">Voir</Button>
          <Button variant="contained">Modifier</Button>
        </Grid>
      </Grid>
    </div>
  );
};

export default Settings;
